import React, { useState } from 'react';
import { Card, Typography, Box, Button, Grid, Avatar } from '@mui/material';
import ChampionImage from './ChampionImage';
import ItemImages from './ItemImages';

function Match({ match }) {
  const [isExpanded, setIsExpanded] = useState(false);

  const toggleExpand = () => setIsExpanded(!isExpanded);

  const {
    champion,
    win,
    items = [],
    kills,
    deaths,
    assists,
    gameMode,
    participants = [],
    version = "14.21.1",
  } = match;

  const matchOutcome = win ? 'Victory' : 'Defeat';
  const matchBgColor = win ? '#0d47a1' : '#b71c1c';

  return (
    <Card
      variant="outlined"
      sx={{
        mb: 2,
        backgroundColor: matchBgColor,
        color: '#f0f0f0',
        boxShadow: 4,
        borderRadius: 2,
        p: 2,
      }}
    >
      {/* Default Match View */}
      <Box display="flex" justifyContent="space-between" alignItems="center">
        <Box display="flex" alignItems="center">
          <ChampionImage champion={champion} version={version} />
          <Box ml={2}>
            <Typography variant="h6">{matchOutcome}</Typography>
            <Typography variant="body2">{kills}/{deaths}/{assists} K/D/A</Typography>
            <Typography variant="body2">Mode: {gameMode}</Typography>
          </Box>
        </Box>
        <ItemImages items={items} version={version} />
      </Box>

      {/* Teams Display */}
      <Box display="flex" justifyContent="space-between" mt={2}>
        <Box width="45%">
          <Typography variant="subtitle1">Team 1:</Typography>
          {participants.slice(0, 5).map((p, index) => (
            <Box key={index} display="flex" alignItems="center" mb={0.5}>
              <Avatar
                src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${p.championName}.png`}
                alt={p.championName}
                sx={{ width: 20, height: 20, mr: 0.5 }}
              />
              <Typography variant="caption">{p.summonerName}</Typography>
            </Box>
          ))}
        </Box>
        <Box width="45%">
          <Typography variant="subtitle1">Team 2:</Typography>
          {participants.slice(5).map((p, index) => (
            <Box key={index} display="flex" alignItems="center" mb={0.5}>
              <Avatar
                src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${p.championName}.png`}
                alt={p.championName}
                sx={{ width: 20, height: 20, mr: 0.5 }}
              />
              <Typography variant="caption">{p.summonerName}</Typography>
            </Box>
          ))}
        </Box>
      </Box>

      {/* Expandable Full Details */}
      <Box mt={2}>
        <Button onClick={toggleExpand} variant="text" color="primary">
          {isExpanded ? "Hide Full Details" : "Show Full Details"}
        </Button>
        {isExpanded && (
          <Box mt={2} sx={{ backgroundColor: '#1f2937', p: 2, borderRadius: '8px' }}>
            <Typography variant="subtitle1">Player Stats:</Typography>
            <Grid container spacing={2}>
              {participants.map((p, index) => (
                <Grid item xs={6} key={index}>
                  <Box display="flex" alignItems="center">
                    <Avatar
                      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${p.championName}.png`}
                      alt={p.championName}
                      sx={{ width: 30, height: 30, mr: 1 }}
                    />
                    <Typography variant="body2" fontWeight="bold">{p.summonerName}</Typography>
                  </Box>
                  <Typography variant="body2">KDA: {p.kills}/{p.deaths}/{p.assists}</Typography>
                  <ItemImages items={p.items} version={version} />
                </Grid>
              ))}
            </Grid>
          </Box>
        )}
      </Box>
    </Card>
  );
}

export default Match;
